// SPDX-License-Identifier: MIT OR LGPL-2.0-or-later
pragma solidity ^0.8.5;

// import "@openzeppelin/upgrades/contracts/Initializable.sol";

import "./Pausable.sol";
import "./ExternalStorage.sol"; 
import "./Escrow.sol";
import "./Libs/Safemath.sol";

/**
 * @dev Contract module for user management.
 *
 * This module is used through inheritance. It will make available the contract
 * addresses of users, admin, whitelisting and blacklisting of users.
 */
contract Operations is Pausable, ExternalStorage {
    using SafeMath for uint256;

    event AddedAdmin(address indexed _admin);
    event RemovedAdmin(address indexed _admin);
    event AddedAuthorizer(address indexed _authorizer);
    event RemovedAuthorizer(address indexed _authorizer);
    event AddedAirlineList(address indexed _airline);
    event RemovedAirlineList(address _airline);
    event SetAddressList(address indexed _user);
    event RemoveAddressList(address _user);
    event AddedBlackList(address _user);
    event RemovedBlackList(address _user);
    event DestroyedBlackFunds(address _User, uint256 _amount);
    event PassengersClaims(address indexed flightEscrow, uint256 amountclaimed, uint256 passengerNo);

    modifier isAdminAddr(address _admin) {
        require(isAdmin[_admin]);
        _;
    }

    modifier notAdmin(address admin) {
        require(!isAdmin[admin]);
        _;
    }

    modifier isAuthorizerAddr(address authorizer) {
        require(isAuthorizer[authorizer]);
        _;
    }

    modifier notAuthorizer(address authorizer) {
        require(!isAuthorizer[authorizer]);
        _;
    }

    modifier notAirline(address airline) {
        require(!isAirLineListed[airline]);
        _;
    }

    modifier notNull(address _address) {
        require(_address != address(0x0));
        _;
    }

    modifier checkAirlineList(address _user) {
        require(isAirLineListed[_user]);
        _;
    }

    modifier checkUserList(address _user) {
        require(isUserListed[_user]);
        _;
    }

    constructor() {
        isUserListed[_msgSender()] = true;
        usersList.push(_msgSender());

        AddAdmin(_msgSender());
        // AddAuthorizer(_msgSender());
    }

    //adds address as admin and also authorizers the address
    function AddAdmin(address _AdminID)
        public
        onlyOwner
        notAdmin(_AdminID)
        checkUserList(_AdminID)
        whenNotPaused
        returns (bool)
    {
        admins.push(_AdminID);
        isAdmin[_AdminID] = true;

        emit AddedAdmin(_AdminID);

        return true;
    }

    //Removes and Admin
    function RemoveAdmin(address _addr)
        public
        onlyOwner
        isAdminAddr(_addr)
        returns (bool)
    {
        for (uint256 i = 0; i < admins.length - 1; i++)
            if (admins[i] == _addr) {
                admins[i] = admins[admins.length - 1];
                break;
            }
        admins.pop();
        isAdmin[_addr] = false;

        emit RemovedAdmin(_addr);

        return true;
    }

    //Get all listed Admins on the System
    function GetAdminList()
        public
        view
        isAdminAddr(_msgSender())
        returns (address[] memory)
    {
        return admins;
    }

    //adds address as airline 
    function AddAirline(address _airline)
        public
        onlyOwner
        notAirline(_airline)
        checkUserList(_airline)
        whenNotPaused
        returns (bool)
    {
        require(!isBlackListed[_airline], "Aeropaye: Airline is BlackListed");
        airlinesList.push(_airline);
        isAirLineListed[_airline] = true;

        emit AddedAirlineList(_airline);

        return true;
    }

    //Removes an Airline
    function RemoveAirline(address _addr)
        public
        onlyOwner
        checkAirlineList(_addr)
        returns (bool)
    {
        for (uint256 i = 0; i < airlinesList.length - 1; i++)
            if (airlinesList[i] == _addr) {
                airlinesList[i] = airlinesList[airlinesList.length - 1];
                break;
            }
        airlinesList.pop();
        isAirLineListed[_addr] = false;

        emit RemovedAirlineList(_addr);

        return true;
    }

    //Get all listed Admins on the System
    function GetAirlineList()
        public
        view
        checkAirlineList(_msgSender())
        returns (address[] memory)
    {
        return airlinesList;
    }

    //Authorizer Rights and Functions
    function AddAuthorizer(address authorizer)
        public
        onlyOwner
        checkUserList(authorizer)
        notAuthorizer(authorizer)
        whenNotPaused
        returns (bool)
    {
        isAuthorizer[authorizer] = true;
        authorizers.push(authorizer);

        emit AddedAuthorizer(authorizer);

        return true;
    }

    // Remove authorizer
    function RemoveAuthorizer(address _authorizer)
        public
        onlyOwner
        isAuthorizerAddr(_authorizer)
        returns (bool)
    {
        for (uint256 i = 0; i < authorizers.length - 1; i++)
            if (authorizers[i] == _authorizer) {
                authorizers[i] = authorizers[authorizers.length - 1];
                break;
            }
        authorizers.pop();
        isAuthorizer[_authorizer] = false;

        emit RemovedAuthorizer(_authorizer);

        return true;
    }

    // Get all listed authorizers on the System
    function GetAuthorizerList()
        public
        view
        isAdminAddr(_msgSender())
        returns (address[] memory)
    {
        return authorizers;
    }

    // List users on the System
    function SetUserList(address _addr)
        public
        notNull(_addr)
        whenNotPaused
        returns (bool)
    {
        require(isUserListed[_addr] != true, "Address has been Whitelisted");
        isUserListed[_addr] = true;
        usersList.push(_addr);

        emit SetAddressList(_addr);

        return true;
    }

    // Remove users from whitelist
    function RemoveUserList(address _addr)
        public
        isAdminAddr(_msgSender())
        notNull(_addr)
        returns (bool)
    {
        require(isUserListed[_addr], "Address not a Listed User");

        if (isAdmin[_addr]) {
            RemoveAdmin(_addr);
        }

        for (uint256 i = 0; i < usersList.length - 1; i++)
            if (usersList[i] == _addr) {
                usersList[i] = usersList[usersList.length - 1];
                break;
            }
        usersList.pop();
        isUserListed[_addr] = false;

        emit RemoveAddressList(_addr);

        return true;
    }

    //Get all listed users in the System
    function GetUsersList()
        public
        view
        isAdminAddr(_msgSender())
        returns (address[] memory)
    {
        return usersList;
    }

    // Add adress to BlackList
    function AddBlackList(address _evilUser)
        public
        isAdminAddr(_msgSender())
        checkUserList(_evilUser)
    {
        require(!isBlackListed[_evilUser], "User already BlackListed");

        if (isAdmin[_evilUser]) {
            RemoveAdmin(_evilUser);
        }
        if (isAuthorizer[_evilUser]) {
            RemoveAuthorizer(_evilUser);
        }

        blackList.push(_evilUser);
        isBlackListed[_evilUser] = true;

        emit AddedBlackList(_evilUser);
    }

    // Remove Address from BlackList
    function RemoveBlackList(address _clearedUser)
        public
        isAdminAddr(_msgSender())
        notNull(_clearedUser)
        returns (bool)
    {
        require(isBlackListed[_clearedUser], "Address not a Listed User");

        for (uint256 i = 0; i < usersList.length - 1; i++)
            if (blackList[i] == _clearedUser) {
                blackList[i] = blackList[blackList.length - 1];
                break;
            }
        blackList.pop();
        isBlackListed[_clearedUser] = false;

        emit RemovedBlackList(_clearedUser);

        return true;
    }

    //Get all who is blacklisted on the System
    function GetBlackListed()
        public
        view
        isAdminAddr(_msgSender())
        returns (address[] memory)
    {
        return blackList;
    }

    function IsBlackListed(address _address)
        public
        view
        returns (bool)
        {
        return isBlackListed[_address];
        }

    //Check if it's a user
    function IsUserList(address _user)
        public
        view
        returns (bool)
    {
        return (isUserListed[_user]);
    }

    //Check if it is an airline address
    function IsAirLineList(address _user)
        public
        view
        returns (bool)
    {
        return (isAirLineListed[_user]);
    }

    //Booking passengers
    function FlightBookPassengers(
        Escrow _flightEscrow,
        address _passenger,
        address _bookedBy,
        string memory _flightClass,
        uint256 _flightCost,
        uint32 _flightStatus,
        string memory _flightSeat,
        uint256 _flightRefund
        )
        external
        checkUserList(_bookedBy)
        returns (bool)
    {
        EscrowPassengers storage escrowFlightSave = flightPassengers[address(_flightEscrow)];
            PassengerBookingDetails memory escrowPassengerSave = 
            PassengerBookingDetails(
                    {  
                        FlightID: address(_flightEscrow),
                        BookedBy: _bookedBy,
                        FlightClass: _flightClass,
                        FlightCost: _flightCost,
                        FlightCostClaimed: 0,
                        FlightStatus: uint32(FlightStatus(_flightStatus)),
                        FlightSeat: _flightSeat,
                        FlightRefund: _flightRefund,
                        CheckedIn: false
    });
        escrowFlightSave.passengers[_passenger].push(escrowPassengerSave);
        return true;
    }

     //Claim amount withdrawal check
    function PassengerManifest(
        address _flightEscrow, 
        address _passenger,
        uint256  _keyId
        )
        view
        external
        //Check if user is authorized to access function
        returns (PassengerBookingDetails memory){
            PassengerBookingDetails memory passengerManifest = flightPassengers[_flightEscrow].passengers[_passenger][_keyId];
       return passengerManifest;
    }

    //Passenger CheckIn to board flight
    function PassengersCheckIn(
        address _flightEscrow,
        address _passenger,
        uint256  _keyId
        ) 
        external
        returns (bool){
            flightPassengers[address(_flightEscrow)].passengers[_passenger][_keyId].CheckedIn = true;

        return true;
    }

    //Update PassengerManifest
    function CancelPassengerBooking(
        address _flightEscrow, 
        address _passenger,
        uint256  _keyId,
        uint256 _cancelBookingRefund,
        uint256 _platformFee
    )
        external
        //chcek if airline is authorizeed to access and Update
        checkUserList(_passenger)
        returns(bool){
            require(flightPassengers[address(_flightEscrow)].passengers[_passenger][_keyId].BookedBy == _passenger, "Operations: Sender is Not Passenger that Booked Flight");
            flightPassengers[address(_flightEscrow)].passengers[_passenger][_keyId].FlightStatus = uint32(FlightStatus.CANCELLED);
            uint256 flightCost = flightPassengers[address(_flightEscrow)].passengers[_passenger][_keyId].FlightCost;
            uint calFlightRefund = flightCost.sub((flightCost.mul(_platformFee)).div(100));
            uint256 FlightRefund = calFlightRefund.sub((calFlightRefund.mul(_cancelBookingRefund)).div(100));
            flightPassengers[address(_flightEscrow)].passengers[_passenger][_keyId].FlightRefund = FlightRefund;

        return true;
    }

    //Disable Passenger claim after passenger has claims
    function DeleteClaim (
        Escrow _flightEscrow, 
        address _passenger,
        uint256  _keyId
        )
        external
        checkUserList(_passenger)
        returns (bool){
            require(!isBlackListed[_passenger], "Operations: Claimant is Blacklisted");
            flightPassengers[address(_flightEscrow)].passengers[_passenger][_keyId].FlightCostClaimed = 1;
        return true;
    }

    //claims details
    function Claims(
        address _flightEscrow,
        uint256 _amountClaimed
    )
    external
    returns(bool){
        uint256 amountClaimed = PassengerClaim[_flightEscrow].TotalAmountClaimed;
        uint256 passengerCount = PassengerClaim[_flightEscrow].NumberOfPassengers;

            amountClaimed += _amountClaimed;
            PassengerClaim[_flightEscrow] = PassengerClaims(amountClaimed, passengerCount++);

            emit PassengersClaims(_flightEscrow, amountClaimed, passengerCount++);
        return true;
    }

    //set refunds
    function SetRefunds(
        address _airline,
        uint32 _flight,
        uint32 _booking,
        uint32 _delayed
    )
    external
    checkUserList(_airline)
    returns(bool){
        require(!isBlackListed[_airline], "Operations: Airline is Blacklisted");
        require(isAdmin[_msgSender()] || isAirLineListed[_airline], "Operations: Not an Admin or Airline");
        refunds[_airline] = RefundSettings(_flight, _booking, _delayed);
        return true;
    }

    //get refunds
    function GetRefunds(address _airline)
    external
    view
    returns(RefundSettings memory){
       RefundSettings memory refunds = refunds[_airline];
       return refunds;
    }
}

